  const [currentForm,setCurrentForm]=useState('login')

  const toggleForm =(formName)=>{
    setCurrentForm(formName);
  }


  return (
    <>



    <div className="App"> 
      <div><Icon/></div>
      <div className='form'><Login onFormSwitch={toggleForm} /></div>
      <div className='Member'> <span className='main'>Not member?</span><span className='create main'> Create account.</span></div>
      <div className='icon3' ><Icon2/></div> 
      </div> 

      <Router>
      <Routes>
      <Route path="/page" element={<Nextpage/>} /> 
      </Routes>
    </Router> 


      {/* <Nextpage/> */}

      {/* <Success/> */}

    </> 


  );
}

export default App;
